(1, 60, 'Duis sed odio sit amet nibh vulputate cursus', 'java-article-1', '<h3><strong><img src="images/joomlavi/blog1.jpg" alt="" width="744" height="302" /></strong></h3>\r\n<p>Proin gravida nibh vel velit auctor aliquet. Aenean sollicitudin, lorem quis bibendum auctor, nisi elit consequat ipsum, nec sagittis sem nibh id elit. Duis sed odio sit amet nibh vulputate cursus a sit amet mauris. Morbi accumsan ipsum velit. Nam nec tellus a odio tincidunt auctor a ornare odio. Sed non mauris vitae erat consequat auctor eu in elit. Class aptent taciti sociosqu ad litora torquent per conubia nostra, per inceptos himenaeos.</p>\r\n', '\r\n<p> </p>\r\n<h3><strong>Objectives:</strong></h3>\r\n<ul>\r\n<li>How to add a navigation drawer to you app?</li>\r\n<li>How to populate the drawer list?</li>\r\n<li>How to open the drawer by clicking on the app icon “top-left icon”?</li>\r\n<li>How to handle click events?</li>\r\n</ul>', 1, 8, '2014-05-22 16:00:56', 262, '', '2014-05-23 04:13:32', 262, 0, '0000-00-00 00:00:00', '2014-05-22 16:00:56', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 5, 5, '', '', 1, 22, '{"robots":"",