(16, 78, 'import android.support.v4 cannot be resolved', 'java-article-2', '<h3>Solutions:</h3>\r\n<ol>\r\n<li>Go to your Project''s Properties</li>\r\n<li>Navigate to the Java Build Path</li>\r\n<li>Then go to the Libraries tab. There click the Add External JARs Button on the Right pane.</li>\r\n<li>Select the android-support-v4.jar file, usually the path for the <strong>Jar file</strong> is :<br /> <strong><em>YOUR_DRIVE\\android-sdks\\extras\\android\\support\\v4\\android-support-v4.jar</em></strong> </li>\r\n<li>After adding andorid-support-v4.jar Library, navigate to the Order and Export tab and put check mark on the android-support-v4 Library file.</li>\r\n<li>After doing the above, <strong>Clean</strong> the Project and <strong>Build</strong> it.</li>\r\n<li><em>Problem Solved.</em></li>\r\n</ol>', '', 1, 9, '2014-05-02 16:00:00', 262, '', '2014-06-04 09:36:38', 262, 0, '0000-00-00 00:00:00', '2014-06-02 16:00:00', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 4, 4, '', '', 1, 21, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
